export function Input() {
	return (
		<div className="w-full h-2/3 flex items-end border-0 rounded-md bg-skin-main">
			<div className="w-1/6 h-full flex justify-center items-center">
				<div className="w-1/3 h-4/5 border border-skin-circle rounded-full flex justify-center items-center">
					<img src="../icon-check.svg" alt="check" width="20" height="20"/>
				</div>
			</div>
		</div>
	)
}
